import React from "react";

class Text2 extends React.Component{
    render() {
        return(
            <div>
             <div>What do you do with my stuff?</div>
             <div>We refurbish old things and sell it to</div>
             <div>the people who cannot afford or don't</div>
             <div>want to buy brand new stuff</div>
            </div>
        );
     }
}

export default Text2;
